import React from 'react';

const HelpPage = ({ setShowCart }) => {
  const onLogoClickHandler = () => {
    setShowCart(false); // Đảm bảo rằng setShowCart là một hàm
  };

  return (
    <div>
      <h1>Help Page</h1>
      <button onClick={onLogoClickHandler}>Hide Cart</button>
    </div>
  );
};

export default HelpPage;
